(1, ' Agencja Zatrudnienia Efekt Spółka z Ograniczoną Odpowiedzialnością Spółka Komandytowa', '', 'efekt,agencja pracy', '2021-11-22/efekt-polityka-strona.pdf', '2021-11-22/efekt_poziom2.png', 'https://www.facebook.com/AgencjaZatrudnieniaEfekt/', '', '', '', 3, '„Wyrażam zgodę na przetwarzanie danych osobowych podanych w formularzu. Podanie danych jest dobrowolne. Administratorem podanych przez Pana/Panią danych osobowych jest Agencja Zatrudnienia Efekt Spółka z Ograniczoną Odpowiedzialnością Spółka Komandytowa z siedzibą w ul. Wyzwolenia 4, Strzelce Krajeńskie 66-500. Pana/Pani dane będą przetwarzane w celach związanych z udzieleniem odpowiedzi, przedstawieniem oferty usług Agencji Zatrudnienia Efekt Spółka z Ograniczoną Odpowiedzialnością Spółka Komandytowej oraz świadczeniem usług przez administratora danych. Przysługuje Panu/Pani prawo dostępu do treści swoich danych oraz ich poprawiania.”\n', '„Wyrażam zgodę na otrzymywanie informacji handlowych od \"Agencji Zatrudnienia Efekt Spółka z Ograniczoną Odpowiedzialnością Spółka Komandytowa\" dotyczących jej oferty poprzez wiadomości elektroniczne z wykorzystaniem adresu email podanego w formularzu, a także zgodę na przetwarzanie moich danych osobowych w tym celu przez Agencję Zatrudnienia Efekt Spółka z Ograniczoną Odpowiedzialnością Spółka Komandytowa oraz w celach promocji, reklamy i badania rynku.”\r\n', '„Wyrażam zgodę na otrzymywanie informacji handlowych od Agencja Zatrudnienia Efekt Spółka z Ograniczoną Odpowiedzialnością Spółka Komandytowa dotyczących jej oferty w szczególności poprzez połączenia telefoniczne lub sms z wykorzystaniem numeru telefonu podanego w formularzu, a także zgodę na przetwarzanie moich danych osobowych w tym celu przez Agencja Zatrudnienia Efekt Spółka z Ograniczoną Odpowiedzialnością Spółka Komandytowa oraz w celach promocji, reklamy i badania rynku.”', 'https://www.instagram.com/efekt_agencja_zatrudnienia/?hl=pl', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque imperdiet ante eu dolor euismod, nec finibus ipsum eleifend. Quisque scelerisque nisi arcu, vel bibendum magna porttitor id erat curae.', '2021-12-04/efekt_poziom.png');

