anych z udzieleniem odpowiedzi, przedstawieniem oferty us\\u0142ug Agencja Zatrudnienia Efekt Sp\\u00f3\\u0142ka z Ograniczon\\u0105 Odpowiedzialno\\u015bci\\u0105 Sp\\u00f3\\u0142ka Komandytowa oraz \\u015bwiadczeniem us\\u0142ug przez administratora danych. Przys\\u0142uguje Panu\\/Pani prawo dost\\u0119pu do tre\\u015bci swoich danych oraz ich poprawiania.\\u201d\\n\",\"rodo2\":\"\\u201eWyra\\u017cam zgod\\u0119 na otrzymywanie informacji handlowych od Agencja Zatrudnienia Efekt Sp\\u00f3\\u0142ka z Ograniczon\\u0105 Odpowiedzialno\\u015bci\\u0105 Sp\\u00f3\\u0142ka Komandytowa dotycz\\u0105cych jej oferty poprzez wiadomo\\u015bci elektroniczne z wykorzystaniem adresu email podanego w formularzu, a tak\\u017ce zgod\\u0119 na przetwarzanie moich danych osobowych w tym celu przez Agencja Zatrudnienia Efekt Sp\\u00f3\\u0142ka z Ograniczon\\u0105 Odpowiedzialno\\u015bci\\u0105 Sp\\u00f3\\u0142ka Komandytowa oraz w celach promocji, reklamy i badania rynku.\\u201d\\n\",\"rodo3\":\"\\u201eWyra\\u017cam zgod\\u0119 na otrzymywanie informacji handlowych od Agencja Zatrudnienia Efekt Sp\\u00f3\\u0142ka z Ograniczon\\u0105 Odpowiedzialno\\u015bci\\u0105 Sp\\u00f3\\u0142ka Komandytowa dotycz\\u0105cych jej oferty w szczeg\\u00f3lno\\u015bci poprzez po\\u0142\\u0105czenia telefoniczne lub sms z wykorzystaniem numeru telefonu podanego w formularzu, a tak\\u017ce zgod\\u0119 na przetwarzanie moich danych osobowych w tym celu przez Agencja Zatrudnienia Efekt Sp\\u00f3\\u0142ka z Ograniczon\\u0105 Odpowiedzialno\\u015bci\\u0105 Sp\\u00f3\\u0142ka Komandytowa oraz w celach promocji, reklamy i badania rynku.\\u201d\",\"ig_link\":\"https:\\/\\/www.instagram.com\\/efekt_agencja_zatrudnienia\\/?hl=pl\"}', 'pl_settings'),
